import "./Header.css";

const Header = () => {
  return (
    <header>
      <div className="header--logo"></div>
      <a href="/">
        <img
          src="https://upload.wikimedia.org/wikipedia/commons/1/15/Logonfx.png"
          alt="no conection"
        ></img>
      </a>
    </header>
  );
};

export default Header;
